import React from 'react';

function StoryList(props){
   // const { stories } = props
    const items = stories.map((item) => 
        <li>
            <button className="collapsible">{item.summary}</button>
            <div className="content">
                <p>{item.type}</p>
                <p>{item.description}</p>
            </div>
        </li>
    );
    return (
        <div className="container">
            <h3 className="text-center">Tickets</h3>
            <ul>{items}</ul>
        </div>
    )
}


const stories = [
    {
        summary: "test",
        type: "test",
        complexity: "test",
        time: "test",
        cost: "test",
        description: "test",
    },
    {
        summary: "test",
        type: "test",
        complexity: "test",
        time: "test",
        cost: "test",
        description: "test",
    }
]

export default StoryList;
